// 获取上一个节点的输出
const stdout = $input.first().json.stdout;

// 获取文件夹名字
const folderName = $input.first().json.poemDir || $input.first().json['文件夹名字'];

// 检查是否有输出
if (!stdout || stdout.trim() === '') {
  throw new Error(`在 /mnt/${folderName} 中没有找到图片文件`);
}

// 分割文件路径并过滤空行
const filePaths = stdout
  .trim()
  .split('\n')
  .filter(path => path && path.trim());

// 检查是否找到文件
if (filePaths.length === 0) {
  throw new Error(`没有找到任何图片文件`);
}

// 构建图片对象数组
// 将 /mnt/ 路径转换为 /app/n8n_shared/ 路径
const imageArray = filePaths.map(filePath => {
  // 替换路径: /mnt/ -> /app/n8n_shared/
  const apiPath = filePath.trim().replace('/mnt/', '/app/n8n_shared/');

  return {
    provider: "local",
    url: apiPath
    // 移除了 duration 字段
  };
});

// 转换为 JSON 字符串 (格式化输出,便于调试)
const imageListString = JSON.stringify(imageArray, null, 2);

// 返回结果
return [{
  json: {
    images: imageArray,              // 数组格式,用于 API 调用
    imageListString: imageListString, // 字符串格式,用于查看
    totalImages: imageArray.length,   // 图片总数
    folderName: folderName            // 文件夹名字
  }
}];
